import React from 'react';
import {StyleSheet, Text, View, ScrollView, Image, TouchableWithoutFeedback} from 'react-native';
import {createAppContainer, Navigation} from 'react-navigation';
import { createStackNavigator } from '@react-navigation/stack';
import restaurantes from './Restaurantes';  
import home from './Home';  


const Stack = createStackNavigator();
export default function Cart() {
return(
    <NavigationContainer>
    <Stack.Navigator initialroute='Home'>
    <Stack.Screen name="Home" component={restaurantes} />
    <Stack.Screen name="Restaurantes" component={Restaurantes} />
    </Stack.Navigator>
    </NavigationContainer>

);
}

function RestauranteManu(restaurante){
    return(
        <ScrollView>
            <Image source={restaurante.image} style={styles.image}/> 

        </ScrollView>
    );
}



